import 'bootstrap/dist/css/bootstrap.min.css';

import './index.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import dr_logo from './icons/doctor.png';

function NavScrollExample() {
  return (
    <Navbar bg="primary" data-bs-theme="dark">
      <Container fluid>
        <Navbar.Brand href="/"><h3>Health Services(Rename)</h3></Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="/Doctors_Dashboard">
            <img src={dr_logo} alt="Dr"/> Search Doctors</Nav.Link>
            <Nav.Link href="/VC_Doctors">Video Consultations</Nav.Link>
            <Nav.Link href="/Pharmacy">Pharmacy</Nav.Link>
            <Nav.Link href="/Lab_Tests">Lab Tests</Nav.Link>
            <NavDropdown title="Extra" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action4">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5">
                Something else here
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="#" disabled>
              Extra
            </Nav.Link>
          </Nav>

            <Button variant="outline-light">Login</Button>

        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
